// src/components/admin/pricing/AdminPricingList.jsx
import React from "react";
import { Link } from "react-router-dom";
import {
  useGetAllPlansAdminQuery,
  useDeletePlanMutation,
  useTogglePlanStatusMutation,
} from "../../../redux/api/pricingApi";
import toast from "react-hot-toast";

const AdminPricingList = () => {
  const { data, isLoading, isFetching, refetch } = useGetAllPlansAdminQuery();
  const [deletePlan] = useDeletePlanMutation();
  const [togglePlanStatus] = useTogglePlanStatusMutation();

  const plans = data?.plans || [];

  const handleDelete = async (id) => {
    if (!window.confirm("Delete this plan?")) return;
    try {
      await deletePlan(id).unwrap();
      toast.success("Deleted");
      refetch();
    } catch (err) {
      console.error(err);
      toast.error("Delete failed");
    }
  };

  const handleToggle = async (id) => {
    try {
      await togglePlanStatus(id).unwrap();
      toast.success("Status updated");
      refetch();
    } catch (err) {
      console.error(err);
      toast.error("Update failed");
    }
  };

  return (
    <div>
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h3>Pricing Plans</h3>
        <Link to="/admin/plans/new" className="btn btn-success">
          Add Plan
        </Link>
      </div>

      {isLoading || isFetching ? (
        <div>Loading...</div>
      ) : (
        <table className="table table-striped">
          <thead>
            <tr>
              <th>Name</th>
              <th>Price</th>
              <th>Cycle</th>
              <th>Max Images</th>
              <th>Featured</th>
              <th>Priority</th>
              <th>Status</th>
              <th style={{ width: 220 }}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {plans.map((p) => (
              <tr key={p._id}>
                <td>{p.name}</td>
                <td>
                  {p.currency} {p.price}
                </td>
                <td>{p.billingCycle}</td>
                <td>{p.maxPortfolioImages}</td>
                <td>{p.featuredBadge ? "Yes" : "No"}</td>
                <td>{p.priority}</td>
                <td>{p.status}</td>
                <td>
                  <Link
                    className="btn btn-sm btn-primary me-2"
                    to={`/admin/pricing/${p._id}`}
                  >
                    Edit
                  </Link>
                  <button
                    className="btn btn-sm btn-warning me-2"
                    onClick={() => handleToggle(p._id)}
                  >
                    {p.status === "active" ? "Deactivate" : "Activate"}
                  </button>
                  <button
                    className="btn btn-sm btn-danger"
                    onClick={() => handleDelete(p._1d || p._id)}
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
            {!plans.length && (
              <tr>
                <td colSpan="8" className="text-center">
                  No plans found
                </td>
              </tr>
            )}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AdminPricingList;
